import React from "react";
import "./Hamburger.css";

function Hamburger({ isOpen }) {
  return (
    <>
      <div className="hamburger">
        <div className="bar"></div>
        <div className="bar"></div>
        <div className="bar"></div>
      </div>
    </>
  );
}

export default Hamburger;
